import React, { useState } from "react";
import "./Carousel.css";
import { images } from "../Components/CarouselData";

function Item() {
  state = {
    items: [
      { id: 1, title: "item #1" },
      { id: 2, title: "item #2" },
      { id: 3, title: "item #3" },
      { id: 4, title: "item #4" },
      { id: 5, title: "item #5" },
    ],
  };
  return (
    <Carousel>
      {Item.map((item) => (
        <div key={Item.id}>{Item.title}</div>
      ))}
    </Carousel>
  );
}
export default Item;
